import React from "react";
import { Container } from "./styles";
import Font from "../../component/Font";

const HomePage = () => {
  return (
    <Container>
      <div className="left-content">
        <h1 className="logo archivo">Dink</h1>
        <p>Share links that are short and easy to remember.</p>
        <p>
          Consectetur magna cupidatat occaecat dolor voluptate velit. Culpa in
          aute aute sunt incididunt laboris minim officia occaecat laboris non
          ea. Ullamco in ea quis non cupidatat sint laborum ea deserunt tempor
          eiusmod. Occaecat ad ad consectetur excepteur do cupidatat laboris
          velit labore. Ullamco veniam adipisicing exercitation nisi incididunt
          sint incididunt ullamco ex ullamco dolor amet. Ullamco eiusmod elit
          consequat consequat nisi minim excepteur.
        </p>
        <input placeholder="Paste your link here..." />
      </div>
      <div className="right-content">
        <img
          className="hero-image"
          src={require("../../images/hero-image.png")}
          alt="hero-image"
        />
      </div>
    </Container>
  );
};

export default HomePage;
